import mongoose from "mongoose";
import { TacheSchema } from "../models/tacheModel";

const Tache = mongoose.model('Tache', TacheSchema);

export const addNewTache = async (req, res) => {
  try {
    let tache = await new Tache(req.body);
    tache.save();
